def heapify(arr): 
    for i in range(len(arr) // 2 - 1, -1, -1): 
        largest = i 
        for j in range(i, len(arr)): 
            if arr[j] > arr[largest]: 
                largest = j
        if largest != i: 
            arr[i], arr[largest] = arr[largest], arr[i]
    return arr
